import React from 'react'
import { useDispatch, useSelector } from 'react-redux'

import { CURRENT_USER } from '../utils/constant'

const YourExpenses = () => {
  const allTransaction = useSelector((state) => state.transaction.transactions)
  const currrentUser = useSelector((state) => state.user.user)
  const personlisedTransaction = allTransaction.filter(
    (transact) =>
      transact.paidBy === currrentUser.username &&
      transact.paidFor.find(
        (transactPaidFor) => transactPaidFor === currrentUser
      )
  )
  console.log(personlisedTransaction)
  return (
    <>
      <h1>Hello there</h1>
    </>
  )
}

export default YourExpenses
